INSERT INTO `jos_componentarchitect_codetemplates` VALUES (1,'J 3.3 Standard','<p>Developed from the core Joomla! components of com_content (Articles) and com_contact (Contacts), as they are provided in Joomla! 3.3.</p>\n<p>This template is coded so that selectable core parts of a Joomla! component (e.g. admin section, blog/article layouts, plugins and modules) and Joomla! fields/features can be fully included/excluded from the generated components.\n<p>For further details of the Joomla! Parts generation and Joomla! Fields/Features inclusion for this code template please use the Help system installed with Component Architect Pro or visit the Documentation section of our website at \'www.componentarchitect.com/documentation.html\'.</p>','1.0.5','j_3_3_standard',1,0,0,'Joomla','3.3','PHP,JAVASCRIPT,XML,CSS','architect comp','comp object','[%%','%%]',87,0,'2017-08-04 19:38:55',1,'','2017-08-04 19:38:55',1,0,'0000-00-00 00:00:00',0),
