(2,'LIBRO DE GOBIERNO','<br/>Este libro tiene reglas partículares en el layout',1,0,'jc01','ljc01','ljc01s','ljc01','ljc01s',33,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"include_ordering\":\"\",\"include_params_global\":\"\",\"include_params_menu\":\"\",\"include_params_record\":\"\",\"include_published_dates\":\"\",\"include_status\":\"\",\"include_tags\":\"\",\"include_urls\":\"\",\"include_versions\":\"\"}',1,'2017-08-19 19:39:21',1,'','2017-10-27 22:45:52',1,0,'0000-00-00 00:00:00',3,1),
(3,'LIBRETA DE REGISTRO DE SENTENCIAS -TURNO- (OFICIAL)','<p>Según levantamiento inicial este libro se distribuye por ponencia. </p>\r\n<p>se identificó que el campo \"FIRMA DE QUIEN RECIBE LAS CONSTANCIAS\" pertenece a un empleado del recinto<br /><br /></p>\r\n<p>@ToDo sugerencia: Creo que debería ser un binomio, agregar un campo de fecha de resolución recurrida relacionado con el campo varchar255 para indicar la cuestión recurrida</p>\r\n<p>CHANGELOG</p>\r\n<p>20170922 Separé el campo \"NOMBRE Y FIRMA DE RECEPCIÓN DE LAS CONSTANCIAS\" por \"NOMBRE DE QUIEN RECIBE LAS CONSTANCIAS\" Y \"FIRMA DE QUIEN RECIBE LAS CONSTANCIAS\"</p>\r\n<p>20171001 En reunión 29092017 con la DEGT se identificó que el campo \"FIRMA DE QUIEN RECIBE LAS CONSTANCIAS\" pertenece a un empleado del recinto por lo que se quitó el campo de captura \"NOMBRE DE QUIEN RECIBE LAS CONSTANCIAS\".</p>\r\n<p>20171108 En reunión 20171108 con la DEGT solicitaron: \"Quitar la descripción P3, P de los campos FECHA DE CIRCULACIÓN AP-1 y FECHA DE CIRCULACIÓN AP-3\" (field122,field236)</p>\r\n<p><br />20171115 Cervantes solicitó quitar la distribución (campo ponencia o dpto), los campos FECHA DE CIRCULACIÓN cambiarlos a: FECHA DE CIRCULACIÓN PONENCIA REVISORA y FECHA DE CIRCULACIÓN A PONENCIA REVISORA</p>',1,0,'LIBRETA DE REGISTRO DE SENTENCIAS -TURNO','lsc01','lsc01s','lsc01','lsc01s',4,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"include_ordering\":\"\",\"include_params_global\":\"\",\"include_params_menu\":\"\",\"include_params_record\":\"\",\"include_published_dates\":\"\",\"include_status\":\"\",\"include_tags\":\"\",\"include_urls\":\"\",\"include_versions\":\"\"}',1,'2017-08-19 19:39:21',1,'','2017-12-12 01:01:43',1,1,'2017-12-12 01:01:43',6,1),
(4,'LIBRETA DE REGISTRO DE ASISTENCIA (OFICIAL)','<p>En el requerimiento indicaron que \"SE REQUIERE FIRMA DE ENTRADA Y FIRMA DE SALIDA\".</p>\r\n<p>Existen dos opciones para establecer la mécanica de las firmas.</p>\r\n<p>Una opción es que los usuarios estén obligados a iniciar sesión en el Sistema e ingresar a este libro para introducir una firma de entrada y otra de salida pero puede representar un molestias por el tiempo dedicado a ésta actividad. También puede representar un problema logístico y económico dotar a todos los ordenadores personales de todos los usuarios con lectores electrónicos de firma.</p>\r\n<p>Otra opción es que se utilice un ordenador común, como el del secretario de acuedos como fedatario , y en el formulario aparezca un catálogo con los nombres de los empleados adscritos al recinto para que así ingresen las firmas. Ésto evitaría la molestia de escribir todos los días el nombre.</p>\r\n<p>Puede no ser necesario tener los campos de captura de fecha y hora pues se puede mostrar los que registra el Sistema al momento de adjuntar el archivo digital de la firma.</p>\r\n<p>En reunión con la DEGT aceptan la propuesta de desplegar los nombres adscritos al recinto en un selector y tomar las fechas de sistema y mostrarlas sin que sea necesario capturarlas.</p>\r\n<p>CHANGELOG</p>\r\n<p>20170907 Quité el campo 127 \"FECHA\" y cambié la etiqueta de los campos \"HORA DE ENTRADA y HORA DE SALIDA\" por \"FECHA Y HORA DE ENTRADA\" y \"FECHA Y HORA DE SALIDA\"</p>\r\n<p>20170922 Cambié el campo \"NOMBRE Y FIRMA DE ENTRADA Y DE SALIDA\" por \"FIRMA DE ENTRADA\" y Cambié el campo 127 \"FECHA\" por \"FIRMA DE SALIDA\"</p><br/>Este libro se distribuye por secretaría<br/>Este libro tiene reglas partículares en el layout.<br/>20171115 Cervantes solicitó quitar la distribución (campo ponencia o dpto)',1,0,'LIBRETA DE REGISTRO DE ASISTENCIA','lsc02','lsc02s','lsc02','lsc02s',5,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"include_ordering\":\"\",\"include_params_global\":\"\",\"include_params_menu\":\"\",\"include_params_record\":\"\",\"include_published_dates\":\"\",\"include_status\":\"\",\"include_tags\":\"\",\"include_urls\":\"\",\"include_versions\":\"\"}',1,'2017-08-19 19:39:21',1,'','2017-10-27 22:45:52',1,0,'0000-00-00 00:00:00',3,2),
(5,'LIBRETA DE VISTAS AL M.P (OFICIAL)','<p>En la información proporcionada indicaron que el libro \"SE FIRMA POR EL M.P.\"</p>\r\n<p>¿El M.P. visita el recinto jurisdiccional? o ¿Cómo recaban las firmas?</p>\r\n<p>No le veo sentido de que exista campo de FECHA y otro de FECHA DE FIRMA DEL M.P.; ¿acaso el campo FECHA puede tener un valor distinto al campo FECHA DE FIRMA DEL M.P. ?</p>\r\n<p>Está pendiente que indiquen cuantos tómos (distribución) se requieren por Sala y/o cuales cargos deben tener acceso a este libro.</p>\r\n<p>Propongo que esté a nivel de presidencia de sala para que cualquier empleado del recinto pueda capturar.</p>\r\n<p>CHANGELOG</p>\r\n<p>20170922 Separé el campo \"NOMBRE Y FIRMA DE M.P.\" en \"NOMBRE DEL M.P.\" y \"FIRMA DEL M.P.\"</p><br/>Este libro se distribuye por secretaría.<br/>20171115 Cervantes solicitó quitar la distribución (campo ponencia o dpto)',1,0,'LIBRETA DE VISTAS AL M.P','lsc03','lsc03s','lsc03','lsc03s',6,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"include_ordering\":\"\",\"include_params_global\":\"\",\"include_params_menu\":\"\",\"include_params_record\":\"\",\"include_published_dates\":\"\",\"include_status\":\"\",\"include_tags\":\"\",\"include_urls\":\"\",\"include_versions\":\"\"}',1,'2017-08-19 19:39:21',1,'','2017-10-27 22:45:52',1,0,'0000-00-00 00:00:00',3,3),
(6,'LIBRO DE MULTAS (OFICIAL)','<p>Libro a nivel de la secretaria general de la sala.</p>\r\n<p>Si las multas las cobra el órgano jurisdiccional y entran como ingresos al órgano se podría asociar/ingresar automáticamente en el libro correspondiente</p>\r\n<p>No entiendo en qué se diferencía del campo \"JUICIO\"  del campo \"EXPEDIENTE PRINCIPAL\"</p>\r\n<p>CHANGELOG</p>\r\n<p>20170921 modifiqué la etiqueta del campo 142 \"OFICIO (NÚMERO Y FECHA)\" por \"NÚMERO DE OFICIO (CONSECUTIVO)\" y agregué el campo \"FECHA DE EMISIÓN DEL OFICIO\"</p>\r\n<p>20171001 por solicitud de la DEGT se cambia el campo 52 \"FECHA DE EMISIÓN DEL OFICIO\" por \"FECHA DEL OFICIO\" y \"NÚMERO DE OFICIO (CONSECUTIVO)\" por \"NÚMERO DEL OFICIO\".</p>\r\n<p>20170929 DEGT indicó que el campo \"EXPEDIENTE PRINCIPAL\" son campos de texto abierto.</p>',1,0,'LIBRO DE MULTAS','lsc04','lsc04s','lsc04','lsc04s',7,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"in