(14,'LIBRO DE REGISTRO DE AMPAROS (OFICIAL)','<p>El campo juzgado se refiere al juzgado de distrito, el campo expediente es el expediente en el juicio de amparo.</p>\r\n<p>El campo quejoso está de más, pues deberá estár registrado en los campos torales, y podría ser capturado con un selector que liste todas las partes contenciosas. Aun así se dejará como campo de texto libre.</p>\r\n<p>20170929 DEGT indicó que el NÚMERO DE AMPARO no es consecutivos del sistema, es campo abierto de texto.</p>\r\n<p>20170929 DEGT indicó que el campo \"EXPEDIENTE\"  son campos de texto abierto.</p><br/>Este libro se distribuye por secretaría',1,0,'LIBRO DE REGISTRO DE AMPAROS','lsc12','lsc12s','lsc12','lsc12s',15,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"include_ordering\":\"\",\"include_params_global\":\"\",\"include_params_menu\":\"\",\"include_params_record\":\"\",\"include_published_dates\":\"\",\"include_status\":