(15,'PAPELETAS PARA EL PRÉSTAMO DE EXPEDIENTES','<p>De implementarse campos torales vinculados se evitaría la recaptura y permitiría comprobar que la persona que solicita el préstamo tiene interés jurídico. Será de utilidad la implementación de diversas clasificaciones de interés jurídico diferentes a actor y demandado, como puede ser representante legal del actor, etc.</p>\r\n<p>Considero que sería de utilidad agregar también un campo para la captura de la imagen electrónica de la huella digital.</p>\r\n<p>20170929 la DEGT Está pendiente de definirse el libro de papeletas. Propongo que esté a nivel de presidencia de sala para que cualquier empleado del recinto pueda capturar.</p>\r\n<p>CHANGELOG</p>\r\n<p>20170921 Quité el campo FECHA para combinarlo con el campo HORA</p>',1,0,'PAPELETAS PARA EL PRESTAMO DE EXPEDIENTES','lsc13','lsc13s','lsc13','lsc13s',16,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"