(318,'LIBRO DE PÓLIZAS Y FIANZAS (OFICIAL) - egresos','<p>Libro a nivel de la secretaria general de la sala.</p>\r\n<p>OJO éste libro se subdivide en dos, la primera de ellas a ingresos, la segunda subdivisión corresponde a egresos</p>\r\n<p>No es práctico hacer un sólo libro que muestre 2 formularios dependiendo de si es un ingreso o un egreso debido a que se creará confusión sobre cuando hacer un INSERT(ingreso) o un UPDATE (egreso)</p>\r\n<p> </p>\r\n<p>¿Existen relaciones entre el LIBRO DE PÓLIZAS Y FIANZAS (OFICIAL) y LIBRO DE EGRESOS (OFICIAL) y LIBRO DE CONTROL DE BILLETES Y PÓLIZAS (OFICIAL) y LIBRO DE MULTAS (OFICIAL) ? Una duda recurrente es sobre si se pueden relacionar las entradas y salidas de dinero y los billetes.</p>\r\n<p>¿Indican que lo llevan en dos tomos, es factible describirlo como dos libros con datos independientes que comparten la misma cuerda? De ser así se puede implementar como libros digitales independientes .</p>\r\n<p>Necesito ejemplos reales de números de certificado y números de poliza, ¿para cada número de certificado corresponde uno y sólo un número de poliza?</p>\r\n<p>Y si lo hacemos en un sólo libro sin subdivisiones unificando campos?</p>\r\n<p>Habilitaré el segundo campo toca, de ser necesario, cuando se aclare la logística</p>\r\n<p>Respuesta. Se hará en un sólo libro y enla edición se mostrará 2 formularios dependiendo de si es un ingreso o un egreso.</p>\r\n<p>CHANGELOG</p>\r\n<p>20170922 Deshabilité el segundo campo TOCA y modifiqué el code_name porque daba problemas al compilar .</p>\r\n<p>20171109 No se dio seguimiento a las dudas planteadas, se generaron 2 libros, uno para ingresos y otro para egresos</p>',1,0,'LIBRO DE POLIZAS Y FIANZAS','lsc08e','lsc08es','lsc08e','lsc08es',271,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"include_ordering\":\"\",\"include_params_global\":\"\",\"include_params_menu\":\"\",\"include_params_record\":\"\",\"include_published_dates\":\"\",\"include_status\":\"\",\"include_tags\":\"\",\"include_urls\":\"\",\"include_versions\":\"\"}',1,'2017-08-19 19:39:21',1,'','2017-10-27 22:45:52',1,0,'0000-00-00 00:00:00',3,8),
