(5,'Materias en el TSJ CDMX','<ul>\r\n<li>Generar una GUI para desplegar la lista de materias</li>\r\n<li>Generar una categoría para primera y segunda instancia</li>\r\n<li>Agregar un campo descriptivo para ir agregando comentarios sobre los cambios que sufren las materias</li>\r\n<li>Agregar un campo para definir la etiqueta expedienteFriendlyName</li>\r\n<li>Agregar un campo para seleccionar las personalidades jurídicas obtenidas del componente Catálogo General</li>\r\n</ul>','caballeroantonio','1.0.1','caballeroantonio.com','caballeroantonio@hotmail.com','tsj_cmaterias','Copyright (c) 2017 - 2020. All Rights Reserved',1,'','','','','{\"generate_admin\":\"1\",\"generate_site\":\"0\",\"generate_site_views\":\"0\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"0\",\"generate_categories_site_views_category\":\"0\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"0\",\"include_alias\":\"0\",\"include_assetacl\":\"1\",\"include_assetacl_record\":\"0\",\"include_batch\":\"0\",\"include_checkout\":\"0\",\"include_copy\":\"1\",\"include_created\":\"1\",\"include_description\":\"1\",\"include_featured\":\"0\",\"include_hits\":\"0\",\"include_image\":\"0\",\"include_intro\":\"0\",\"include_language\":\"0\",\"include_metadata\":\"0\",\"include_microdata\":\"0\",\"include_modified\":\"1\",\"include_name\":\"0\",\"include_ordering\":\"1\",\"include_params_global\":\"1\",\"include_params_menu\":\"1\",\"include_params_record\":\"0\",\"include_published_dates\":\"0\",\"include_status\":\"1\",\"include_tags\":\"0\",\"include_urls\":\"0\",\"include_versions\":\"1\"