(6,'Component Architect Manager','<p>@ToDo bug : on editor on type CTRL+S do not save, only refresh de page administrator/index.php?option=com_componentarchitect&amp;view=component&amp;layout=edit&amp;id=?</p>\r\n<p> </p>\r\n<p>Component Architect is a Joomla! extension that allows for the automated code generation of other Joomla! extensions (components, modules and plugins).</p>\r\n<p>CHANGELOG</p>\r\n<p>20170728 inicial</p>\r\n<p>20170731 Add ACL, fix bugs</p>\r\n<p>20170804 Add codetemplates</p>\r\n<p>20170805 Add Ant task to debug, fix bugs, add configurations for UCM and history options</p>\r\n<p>20170819 Improve INCLUDE_ALIAS, comment scripts,</p>\r\n<p>20170820 Improve ACL,</p>\r\n<p>20170828 Remove HTML documentations, add LATEX automatic documentation</p>\r\n<p>20170830 Improve INCLUDE_ALIAS</p>\r\n<p>20170831 Add es-ES support, add DB constraints and comments, improve automatic documentation</p>\r\n<p>20170906 Improve DateTime GUI support</p>\r\n<p>20170910 Improve documentation, es-ES suppport</p>\r\n<p>20170913 Start export support</p>\r\n<p>20170915 Add control versions to ComponentArchitect</p>\r\n<p>20170915 Add Copy buttons</p>\r\n<p>20170915 Add Copy buttons</p>\r\n<p>20170921 change install.sql `created` DATETIME NOT NULL DEFAULT <strong>CURRENT_TIMESTAMP</strong>,</p>\r\n<p>20170921 add DATE type</p>\r\n<p> </p>\r\n<p>@ToDo</p>\r\n<p>Finish admin help buttons, JToolbar::help -&gt; pdf#section</p>\r\n<p>Finish dashboard</p>\r\n<p>Finish LATEX manuals or HTML manuals</p>\r\n<p>Finish ExtJS views (grids)</p>\r\n<p>Add state to each object</p>\r\n<p>Finish export support</p>\r\n<p>Add key to id_expediente, field.filter = false quita TABLE.KEY</p>','caballeroantonio','1.2.0tx','caballeroantonio.com','caballeroantonio@hotmail.com','component_architect','Copyright (c)2013 - 2016 Simply Open Source Ltd. (trading as Component Architect). All Rights Reserved',0,'','','','','{\"generate_admin\":\"1\",\"generate_site\":\"0\",\"generate_site_views\":\"0\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"0\",\"generate_categories_site_views_category\":\"0\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"0\",\"include_alias\":\"0\",\"include_assetacl\":\"0\",\"include_assetacl_record\":\"0\",\"include_batch\":\"0\",\"include_checkout\":\"1\",\"include_copy\":\"1\",\"include_created\":\"1\",\"include_description\":\"0\",\"include_featured\":\"0\",\"include_hits\":\"0\",\"include_image\":\"0\",\"include_intro\":\"0\",\"include_language\":\"0\",\"include_metadata\":\"0\",\"include_microdata\":\"0\",\"include_modified\":\"0\",\"include_name\":\"1\",\"include_ordering\":\"1\",\"include_params_global\":\"0\",\"include_params_menu\":\"0\",\"include_params_record\":\"0\",\"include_published_dates\":\"0\",\"include_status\":\"1\",\"include_tags\":\"0\",\"include_urls\":\"0\",\"include_versions\":\"1\"}',1,'2017-09-14 22:08:07',1,'','2017-11-29 17:40:51',1,0,'0000-00-00 00:00:00',28,2),
